const Footer = () => {
  return (
    <footer className="bg-orange-400 text-white p-10">
      <img src="./images/lots.jpg.jpeg"></img>
      <div className="grid grid-cols-2 ">
        <h1 className="text-">Turning waste into value</h1>
      </div>
      <form className="mt-4">
        <input
          type="email"
          placeholder="Your email"
          className="p-2 rounded-l"
        />
        <button className="bg-black text-white py-2 px-4 rounded-r">
          Submit
        </button>
      </form>
    </footer>
  );
};

export default Footer;
